(window.webpackJsonp=window.webpackJsonp||[]).push([[103],{ED7O:function(e){e.exports=[{id:1,type:"  telefonicaopencloud_as_configuration_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to create the AS configuration. If\nomitted, the <code>region</code> argument of the provider is used. Changing this\ncreates a new AS configuration.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_configuration_name",description:'<li><p><a name="scaling_configuration_name"></a><a href="#scaling_configuration_name"><code>scaling_configuration_name</code></a> - <strong>(Required)</strong> The name of the AS configuration. The name can contain letters,\ndigits, underscores(_), and hyphens(-), and cannot exceed 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_config",description:'<li><p><a name="instance_config"></a><a href="#instance_config"><code>instance_config</code></a> - <strong>(Required)</strong> The information about instance configurations. The instance_config\ndictionary data structure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>instance_config</code> block supports:</p>",elementType:"p"},{name:"instance_id",description:'<li><p><a name="instance_id"></a><a href="#instance_id"><code>instance_id</code></a> - <strong>(Optional)</strong> When using the existing instance specifications as the template to\ncreate AS configurations, specify this argument. In this case, flavor, image,\nand disk arguments do not take effect. If the instance_id argument is not specified,\nflavor, image, and disk arguments are mandatory.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor",description:'<li><p><a name="flavor"></a><a href="#flavor"><code>flavor</code></a> - <strong>(Optional)</strong> The flavor ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"image",description:'<li><p><a name="image"></a><a href="#image"><code>image</code></a> - <strong>(Optional)</strong> The image ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"disk",description:'<li><p><a name="disk"></a><a href="#disk"><code>disk</code></a> - <strong>(Optional)</strong> The disk group information. System disks are mandatory and data disks are optional.\nThe dick structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_name",description:'<li><p><a name="key_name"></a><a href="#key_name"><code>key_name</code></a> - <strong>(Required)</strong> The name of the SSH key pair used to log in to the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_data",description:'<li><p><a name="user_data"></a><a href="#user_data"><code>user_data</code></a> - <strong>(Optional)</strong> The user data to provide when launching the instance.\nThe file content must be encoded with Base64.</p>\n</li>',elementType:"li",listDepth:1},{name:"personality",description:'<li><p><a name="personality"></a><a href="#personality"><code>personality</code></a> - <strong>(Optional)</strong> Customize the personality of an instance by\ndefining one or more files and their contents. The personality structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"public_ip",description:'<li><p><a name="public_ip"></a><a href="#public_ip"><code>public_ip</code></a> - <strong>(Optional)</strong> The elastic IP address of the instance. The public_ip structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Metadata key/value pairs to make available from\nwithin the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>disk</code> block supports:</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The disk size. The unit is GB. The system disk size ranges from 40 to 32768,\nand the data disk size ranges from 10 to 32768.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> - <strong>(Required)</strong> The disk type, which must be the same as the disk type available in the system.\nThe options include <code>SATA</code> (common I/O disk type) and <code>SSD</code> (ultra-high I/O disk type).</p>\n</li>',elementType:"li",listDepth:1},{name:"disk_type",description:'<li><p><a name="disk_type"></a><a href="#disk_type"><code>disk_type</code></a> - <strong>(Required)</strong> Whether the disk is a system disk or a data disk. Option <code>DATA</code> indicates\na data disk. option <code>SYS</code> indicates a system disk.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>personality</code> block supports:</p>",elementType:"p"},{name:"path",description:'<li><p><a name="path"></a><a href="#path"><code>path</code></a> - <strong>(Required)</strong> The absolute path of the destination file.</p>\n</li>',elementType:"li",listDepth:1},{name:"contents",description:'<li><p><a name="contents"></a><a href="#contents"><code>contents</code></a> - <strong>(Required)</strong> The content of the injected file, which must be encoded with base64.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>public_ip</code> block supports:</p>",elementType:"p"},{name:"eip",description:"<strong>(Required)</strong> The configuration parameter for creating an elastic IP address\nthat will be automatically assigned to the instance. The eip structure is described below.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>eip</code> block supports:</p>",elementType:"p"},{name:"ip_type",description:'<li><p><a name="ip_type"></a><a href="#ip_type"><code>ip_type</code></a> - <strong>(Required)</strong> The IP address type. The system only supports <code>5_bgp</code> (indicates dynamic BGP).</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth",description:'<li><p><a name="bandwidth"></a><a href="#bandwidth"><code>bandwidth</code></a> - <strong>(Required)</strong> The bandwidth information. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>bandwidth</code> block supports:</p>",elementType:"p"},{name:"size",description:'<li><p><a name="size-1"></a><a href="#size-1"><code>size</code></a> - <strong>(Required)</strong> The bandwidth (Mbit/s). The value range is 1 to 300.</p>\n</li>',elementType:"li",listDepth:1},{name:"share_type",description:'<li><p><a name="share_type"></a><a href="#share_type"><code>share_type</code></a> - <strong>(Required)</strong> The bandwidth sharing type. The system only supports <code>PER</code> (indicates exclusive bandwidth).</p>\n</li>',elementType:"li",listDepth:1},{name:"charging_mode",description:'<li><p><a name="charging_mode"></a><a href="#charging_mode"><code>charging_mode</code></a> - <strong>(Required)</strong> The bandwidth charging mode. The system only supports <code>traffic</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/as_configuration_v1.html",docType:""},{id:2,type:"  telefonicaopencloud_as_group_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to create the AS group. If\nomitted, the <code>region</code> argument of the provider is used. Changing this\ncreates a new AS group.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_group_name",description:'<li><p><a name="scaling_group_name"></a><a href="#scaling_group_name"><code>scaling_group_name</code></a> - <strong>(Required)</strong> The name of the scaling group. The name can contain letters,\ndigits, underscores(_), and hyphens(-),and cannot exceed 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_configuration_id",description:'<li><p><a name="scaling_configuration_id"></a><a href="#scaling_configuration_id"><code>scaling_configuration_id</code></a> - <strong>(Optional)</strong> The configuration ID which defines\nconfigurations of instances in the AS group.</p>\n</li>',elementType:"li",listDepth:1},{name:"desire_instance_number",description:'<li><p><a name="desire_instance_number"></a><a href="#desire_instance_number"><code>desire_instance_number</code></a> - <strong>(Optional)</strong> The expected number of instances. The default\nvalue is the minimum number of instances. The value ranges from the minimum number of\ninstances to the maximum number of instances.</p>\n</li>',elementType:"li",listDepth:1},{name:"min_instance_number",description:'<li><p><a name="min_instance_number"></a><a href="#min_instance_number"><code>min_instance_number</code></a> - <strong>(Optional)</strong> The minimum number of instances.\nThe default value is 0.</p>\n</li>',elementType:"li",listDepth:1},{name:"max_instance_number",description:'<li><p><a name="max_instance_number"></a><a href="#max_instance_number"><code>max_instance_number</code></a> - <strong>(Optional)</strong> The maximum number of instances.\nThe default value is 0.</p>\n</li>',elementType:"li",listDepth:1},{name:"cool_down_time",description:'<li><p><a name="cool_down_time"></a><a href="#cool_down_time"><code>cool_down_time</code></a> - <strong>(Optional)</strong> The cooling duration (in seconds). The value ranges\nfrom 0 to 86400, and is 900 by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"lb_listener_id",description:'<li><p><a name="lb_listener_id"></a><a href="#lb_listener_id"><code>lb_listener_id</code></a> - <strong>(Optional)</strong> The ELB listener IDs. The system supports up to\nthree ELB listeners, the IDs of which are separated using a comma (,).</p>\n</li>',elementType:"li",listDepth:1},{name:"available_zones",description:'<li><p><a name="available_zones"></a><a href="#available_zones"><code>available_zones</code></a> - <strong>(Optional)</strong> The availability zones in which to create\nthe instances in the autoscaling group.</p>\n</li>',elementType:"li",listDepth:1},{name:"networks",description:'<li><p><a name="networks"></a><a href="#networks"><code>networks</code></a> - <strong>(Required)</strong> An array of one or more network IDs.\nThe system supports up to five networks. The networks object structure\nis documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_groups",description:'<li><p><a name="security_groups"></a><a href="#security_groups"><code>security_groups</code></a> - <strong>(Required)</strong> An array of one or more security group IDs\nto associate with the group. The security_groups object structure is\ndocumented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> The VPC ID. Changing this creates a new group.</p>\n</li>',elementType:"li",listDepth:1},{name:"health_periodic_audit_method",description:'<li><p><a name="health_periodic_audit_method"></a><a href="#health_periodic_audit_method"><code>health_periodic_audit_method</code></a> - <strong>(Optional)</strong> The health check method for instances\nin the AS group. The health check methods include <code>ELB_AUDIT</code> and <code>NOVA_AUDIT</code>.\nIf load balancing is configured, the default value of this parameter is <code>ELB_AUDIT</code>.\nOtherwise, the default value is <code>NOVA_AUDIT</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"health_periodic_audit_time",description:'<li><p><a name="health_periodic_audit_time"></a><a href="#health_periodic_audit_time"><code>health_periodic_audit_time</code></a> - <strong>(Optional)</strong> The health check period for instances.\nThe period has four options: 5 minutes (default), 15 minutes, 60 minutes, and 180 minutes.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_terminate_policy",description:'<li><p><a name="instance_terminate_policy"></a><a href="#instance_terminate_policy"><code>instance_terminate_policy</code></a> - <strong>(Optional)</strong> The instance removal policy. The policy has\nfour options: <code>OLD_CONFIG_OLD_INSTANCE</code> (default), <code>OLD_CONFIG_NEW_INSTANCE</code>,\n<code>OLD_INSTANCE</code>, and <code>NEW_INSTANCE</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"notifications",description:'<li><p><a name="notifications"></a><a href="#notifications"><code>notifications</code></a> - <strong>(Optional)</strong> The notification mode. The system only supports <code>EMAIL</code>\nmode which refers to notification by email.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_publicip",description:'<li><p><a name="delete_publicip"></a><a href="#delete_publicip"><code>delete_publicip</code></a> - <strong>(Optional)</strong> Whether to delete the elastic IP address bound to the\ninstances of AS group when deleting the instances. The options are <code>true</code> and <code>false</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_instances",description:'<li><p><a name="delete_instances"></a><a href="#delete_instances"><code>delete_instances</code></a> - <strong>(Optional)</strong> Whether to delete the instances in the AS group\nwhen deleting the AS group. The options are <code>yes</code> and <code>no</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>networks</code> block supports:</p>",elementType:"p"},{name:"id",description:"<strong>(Required)</strong> The network UUID.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>security_groups</code> block supports:</p>",elementType:"p"},{name:"id",description:"<strong>(Required)</strong> The UUID of the security group.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/as_group_v1.html",docType:""},{id:3,type:"  telefonicaopencloud_as_policy_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to create the AS policy. If\nomitted, the <code>region</code> argument of the provider is used. Changing this\ncreates a new AS policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_policy_name",description:'<li><p><a name="scaling_policy_name"></a><a href="#scaling_policy_name"><code>scaling_policy_name</code></a> - <strong>(Required)</strong> The name of the AS policy. The name can contain letters,\ndigits, underscores(_), and hyphens(-),and cannot exceed 64 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_group_id",description:'<li><p><a name="scaling_group_id"></a><a href="#scaling_group_id"><code>scaling_group_id</code></a> - <strong>(Required)</strong> The AS group ID. Changing this creates a new AS policy.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_policy_type",description:'<li><p><a name="scaling_policy_type"></a><a href="#scaling_policy_type"><code>scaling_policy_type</code></a> - <strong>(Required)</strong> The AS policy type. The values can be <code>ALARM</code>, <code>SCHEDULED</code>,\nand <code>RECURRENCE</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_id",description:'<li><p><a name="alarm_id"></a><a href="#alarm_id"><code>alarm_id</code></a> - <strong>(Optional)</strong> The alarm rule ID. This argument is mandatory\nwhen <code>scaling_policy_type</code> is set to <code>ALARM</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"scheduled_policy",description:'<li><p><a name="scheduled_policy"></a><a href="#scheduled_policy"><code>scheduled_policy</code></a> - <strong>(Optional)</strong> The periodic or scheduled AS policy. This argument is mandatory\nwhen <code>scaling_policy_type</code> is set to <code>SCHEDULED</code> or <code>RECURRENCE</code>. The scheduled_policy structure\nis documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"scaling_policy_action",description:'<li><p><a name="scaling_policy_action"></a><a href="#scaling_policy_action"><code>scaling_policy_action</code></a> - <strong>(Optional)</strong> The action of the AS policy. The scaling_policy_action\nstructure is documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"cool_down_time",description:'<li><p><a name="cool_down_time"></a><a href="#cool_down_time"><code>cool_down_time</code></a> - <strong>(Optional)</strong> The cooling duration (in seconds), and is 900 by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>scheduled_policy</code> block supports:</p>",elementType:"p"},{name:"launch_time",description:'<li><p><a name="launch_time"></a><a href="#launch_time"><code>launch_time</code></a> - <strong>(Required)</strong> The time when the scaling action is triggered. If <code>scaling_policy_type</code>\nis set to <code>SCHEDULED</code>, the time format is YYYY-MM-DDThh:mmZ. If <code>scaling_policy_type</code> is set to\n<code>RECURRENCE</code>, the time format is hh:mm.</p>\n</li>',elementType:"li",listDepth:1},{name:"recurrence_type",description:'<li><p><a name="recurrence_type"></a><a href="#recurrence_type"><code>recurrence_type</code></a> - <strong>(Optional)</strong> The periodic triggering type. This argument is mandatory when\n<code>scaling_policy_type</code> is set to <code>RECURRENCE</code>. The options include <code>Daily</code>, <code>Weekly</code>, and <code>Monthly</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"recurrence_value",description:'<li><p><a name="recurrence_value"></a><a href="#recurrence_value"><code>recurrence_value</code></a> - <strong>(Optional)</strong> The frequency at which scaling actions are triggered.</p>\n</li>',elementType:"li",listDepth:1},{name:"start_time",description:'<li><p><a name="start_time"></a><a href="#start_time"><code>start_time</code></a> - <strong>(Optional)</strong> The start time of the scaling action triggered periodically.\nThe time format complies with UTC. The current time is used by default. The time\nformat is YYYY-MM-DDThh:mmZ.</p>\n</li>',elementType:"li",listDepth:1},{name:"end_time",description:'<li><p><a name="end_time"></a><a href="#end_time"><code>end_time</code></a> - <strong>(Optional)</strong> The end time of the scaling action triggered periodically.\nThe time format complies with UTC. This argument is mandatory when <code>scaling_policy_type</code>\nis set to <code>RECURRENCE</code>. The time format is YYYY-MM-DDThh:mmZ.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>scaling_policy_action</code> block supports:</p>",elementType:"p"},{name:"operation",description:'<li><p><a name="operation"></a><a href="#operation"><code>operation</code></a> - <strong>(Optional)</strong> The operation to be performed. The options include <code>ADD</code> (default), <code>REMOVE</code>,\nand <code>SET</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_number",description:'<li><p><a name="instance_number"></a><a href="#instance_number"><code>instance_number</code></a> - <strong>(Optional)</strong> The number of instances to be operated. The default number is 1.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/as_policy_v1.html",docType:""},{id:4,type:"  telefonicaopencloud_blockstorage_volume_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to create the volume. If\nomitted, the <code>region</code> argument of the provider is used. Changing this\ncreates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The size of the volume to create (in gigabytes). Changing\nthis creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Optional)</strong> The availability zone for the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"consistency_group_id",description:'<li><p><a name="consistency_group_id"></a><a href="#consistency_group_id"><code>consistency_group_id</code></a> - <strong>(Optional)</strong> The consistency group to place the volume\nin.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the volume. Changing this updates\nthe volume\'s description.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_id",description:'<li><p><a name="image_id"></a><a href="#image_id"><code>image_id</code></a> - <strong>(Optional)</strong> The image ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Metadata key/value pairs to associate with the volume.\nChanging this updates the existing volume metadata.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the volume. Changing this updates the\nvolume\'s name.</p>\n</li>',elementType:"li",listDepth:1},{name:"snapshot_id",description:'<li><p><a name="snapshot_id"></a><a href="#snapshot_id"><code>snapshot_id</code></a> - <strong>(Optional)</strong> The snapshot ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_replica",description:'<li><p><a name="source_replica"></a><a href="#source_replica"><code>source_replica</code></a> - <strong>(Optional)</strong> The volume ID to replicate with.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_vol_id",description:'<li><p><a name="source_vol_id"></a><a href="#source_vol_id"><code>source_vol_id</code></a> - <strong>(Optional)</strong> The volume ID from which to create the volume.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_type",description:'<li><p><a name="volume_type"></a><a href="#volume_type"><code>volume_type</code></a> - <strong>(Optional)</strong> The type of volume to create.\nChanging this creates a new volume.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/blockstorage_volume_v2.html",docType:""},{id:5,type:"  telefonicaopencloud_compute_floatingip_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Compute client.\nA Compute client is needed to create a floating IP that can be used with\na compute instance. If omitted, the <code>region</code> argument of the provider\nis used. Changing this creates a new floating IP (which may or may not\nhave a different address).</p>\n</li>',elementType:"li",listDepth:1},{name:"pool",description:'<li><p><a name="pool"></a><a href="#pool"><code>pool</code></a> - <strong>(Required)</strong> The name of the pool from which to obtain the floating\nIP. Changing this creates a new floating IP.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/compute_floatingip_v2.html",docType:""},{id:6,type:"  telefonicaopencloud_compute_floatingip_associate_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Compute client.\nKeypairs are associated with accounts, but a Compute client is needed to\ncreate one. If omitted, the <code>region</code> argument of the provider is used.\nChanging this creates a new floatingip_associate.</p>\n</li>',elementType:"li",listDepth:1},{name:"floating_ip",description:'<li><p><a name="floating_ip"></a><a href="#floating_ip"><code>floating_ip</code></a> - <strong>(Required)</strong> The floating IP to associate.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_id",description:'<li><p><a name="instance_id"></a><a href="#instance_id"><code>instance_id</code></a> - <strong>(Required)</strong> The instance to associte the floating IP with.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip",description:'<li><p><a name="fixed_ip"></a><a href="#fixed_ip"><code>fixed_ip</code></a> - <strong>(Optional)</strong> The specific IP address to direct traffic to.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/compute_floatingip_associate_v2.html",docType:""},{id:7,type:"  telefonicaopencloud_compute_instance_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to create the server instance. If\nomitted, the <code>region</code> argument of the provider is used. Changing this\ncreates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the resource.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_id",description:'<li><p><a name="image_id"></a><a href="#image_id"><code>image_id</code></a> - (Optional; Required if <code>image_name</code> is empty and not booting\nfrom a volume. Do not specify if booting from a volume.) The image ID of\nthe desired image for the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"image_name",description:'<li><p><a name="image_name"></a><a href="#image_name"><code>image_name</code></a> - (Optional; Required if <code>image_id</code> is empty and not booting\nfrom a volume. Do not specify if booting from a volume.) The name of the\ndesired image for the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor_id",description:'<li><p><a name="flavor_id"></a><a href="#flavor_id"><code>flavor_id</code></a> - (Optional; Required if <code>flavor_name</code> is empty) The flavor ID of\nthe desired flavor for the server. Changing this resizes the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"flavor_name",description:'<li><p><a name="flavor_name"></a><a href="#flavor_name"><code>flavor_name</code></a> - (Optional; Required if <code>flavor_id</code> is empty) The name of the\ndesired flavor for the server. Changing this resizes the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"user_data",description:'<li><p><a name="user_data"></a><a href="#user_data"><code>user_data</code></a> - <strong>(Optional)</strong> The user data to provide when launching the instance.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_groups",description:'<li><p><a name="security_groups"></a><a href="#security_groups"><code>security_groups</code></a> - <strong>(Optional)</strong> An array of one or more security group names\nto associate with the server. Changing this results in adding/removing\nsecurity groups from the existing server. <em>Note</em>: When attaching the\ninstance to networks using Ports, place the security groups on the Port\nand not the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"availability_zone",description:'<li><p><a name="availability_zone"></a><a href="#availability_zone"><code>availability_zone</code></a> - <strong>(Optional)</strong> The availability zone in which to create\nthe server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"network",description:'<li><p><a name="network"></a><a href="#network"><code>network</code></a> - <strong>(Optional)</strong> An array of one or more networks to attach to the\ninstance. The network object structure is documented below. Changing this\ncreates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"metadata",description:'<li><p><a name="metadata"></a><a href="#metadata"><code>metadata</code></a> - <strong>(Optional)</strong> Metadata key/value pairs to make available from\nwithin the instance. Changing this updates the existing server metadata.</p>\n</li>',elementType:"li",listDepth:1},{name:"config_drive",description:'<li><p><a name="config_drive"></a><a href="#config_drive"><code>config_drive</code></a> - <strong>(Optional)</strong> Whether to use the config_drive feature to\nconfigure the instance. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_pass",description:'<li><p><a name="admin_pass"></a><a href="#admin_pass"><code>admin_pass</code></a> - <strong>(Optional)</strong> The administrative password to assign to the server.\nChanging this changes the root password on the existing server.</p>\n</li>',elementType:"li",listDepth:1},{name:"key_pair",description:'<li><p><a name="key_pair"></a><a href="#key_pair"><code>key_pair</code></a> - <strong>(Optional)</strong> The name of a key pair to put on the server. The key\npair must already be created and associated with the tenant\'s account.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"block_device",description:'<li><p><a name="block_device"></a><a href="#block_device"><code>block_device</code></a> - <strong>(Optional)</strong> Configuration of block devices. The block_device\nstructure is documented below. Changing this creates a new server.\nYou can specify multiple block devices which will create an instance with\nmultiple disks. This configuration is very flexible, so please see the\nfollowing <a href="http://docs.telefonicaopencloud.org/developer/nova/block_device_mapping.html">reference</a>\nfor more information.</p>\n</li>',elementType:"li",listDepth:1},{name:"scheduler_hints",description:'<li><p><a name="scheduler_hints"></a><a href="#scheduler_hints"><code>scheduler_hints</code></a> - <strong>(Optional)</strong> Provide the Nova scheduler with hints on how\nthe instance should be launched. The available hints are described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"personality",description:'<li><p><a name="personality"></a><a href="#personality"><code>personality</code></a> - <strong>(Optional)</strong> Customize the personality of an instance by\ndefining one or more files and their contents. The personality structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"stop_before_destroy",description:'<li><p><a name="stop_before_destroy"></a><a href="#stop_before_destroy"><code>stop_before_destroy</code></a> - <strong>(Optional)</strong> Whether to try stop instance gracefully\nbefore destroying it, thus giving chance for guest OS daemons to stop correctly.\nIf instance doesn\'t stop within timeout, it will be destroyed anyway.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>network</code> block supports:</p>",elementType:"p"},{name:"uuid",description:'<li><p><a name="uuid"></a><a href="#uuid"><code>uuid</code></a> - (Required unless <code>port</code>  or <code>name</code> is provided) The network UUID to\nattach to the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name-1"></a><a href="#name-1"><code>name</code></a> - (Required unless <code>uuid</code> or <code>port</code> is provided) The human-readable\nname of the network. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - (Required unless <code>uuid</code> or <code>name</code> is provided) The port UUID of a\nnetwork to attach to the server. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip_v4",description:'<li><p><a name="fixed_ip_v4"></a><a href="#fixed_ip_v4"><code>fixed_ip_v4</code></a> - <strong>(Optional)</strong> Specifies a fixed IPv4 address to be used on this\nnetwork. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip_v6",description:'<li><p><a name="fixed_ip_v6"></a><a href="#fixed_ip_v6"><code>fixed_ip_v6</code></a> - <strong>(Optional)</strong> Specifies a fixed IPv6 address to be used on this\nnetwork. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"access_network",description:'<li><p><a name="access_network"></a><a href="#access_network"><code>access_network</code></a> - <strong>(Optional)</strong> Specifies if this network should be used for\nprovisioning access. Accepts true or false. Defaults to false.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>block_device</code> block supports:</p>",elementType:"p"},{name:"uuid",description:'<li><p><a name="uuid-1"></a><a href="#uuid-1"><code>uuid</code></a> - (Required unless <code>source_type</code> is set to <code>"blank"</code> ) The UUID of\nthe image, volume, or snapshot. Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"source_type",description:'<li><p><a name="source_type"></a><a href="#source_type"><code>source_type</code></a> - <strong>(Required)</strong> The source type of the device. Must be one of\n"blank", "image", "volume", or "snapshot". Changing this creates a new\nserver.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_size",description:'<li><p><a name="volume_size"></a><a href="#volume_size"><code>volume_size</code></a> - The size of the volume to create (in gigabytes). Required\nin the following combinations: source=image and destination=volume,\nsource=blank and destination=local, and source=blank and destination=volume.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"boot_index",description:'<li><p><a name="boot_index"></a><a href="#boot_index"><code>boot_index</code></a> - <strong>(Optional)</strong> The boot index of the volume. It defaults to 0.\nChanging this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"destination_type",description:'<li><p><a name="destination_type"></a><a href="#destination_type"><code>destination_type</code></a> - <strong>(Optional)</strong> The type that gets created. Possible values\nare "volume" and "local". Changing this creates a new server.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_on_termination",description:'<li><p><a name="delete_on_termination"></a><a href="#delete_on_termination"><code>delete_on_termination</code></a> - <strong>(Optional)</strong> Delete the volume / block device upon\ntermination of the instance. Defaults to false. Changing this creates a\nnew server.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>scheduler_hints</code> block supports:</p>",elementType:"p"},{name:"group",description:'<li><p><a name="group"></a><a href="#group"><code>group</code></a> - <strong>(Optional)</strong> A UUID of a Server Group. The instance will be placed\ninto that group.</p>\n</li>',elementType:"li",listDepth:1},{name:"different_host",description:'<li><p><a name="different_host"></a><a href="#different_host"><code>different_host</code></a> - <strong>(Optional)</strong> A list of instance UUIDs. The instance will\nbe scheduled on a different host than all other instances.</p>\n</li>',elementType:"li",listDepth:1},{name:"same_host",description:'<li><p><a name="same_host"></a><a href="#same_host"><code>same_host</code></a> - <strong>(Optional)</strong> A list of instance UUIDs. The instance will be\nscheduled on the same host of those specified.</p>\n</li>',elementType:"li",listDepth:1},{name:"query",description:'<li><p><a name="query"></a><a href="#query"><code>query</code></a> - <strong>(Optional)</strong> A conditional query that a compute node must pass in\norder to host an instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"target_cell",description:'<li><p><a name="target_cell"></a><a href="#target_cell"><code>target_cell</code></a> - <strong>(Optional)</strong> The name of a cell to host the instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"build_near_host_ip",description:'<li><p><a name="build_near_host_ip"></a><a href="#build_near_host_ip"><code>build_near_host_ip</code></a> - <strong>(Optional)</strong> An IP Address in CIDR form. The instance\nwill be placed on a compute node that is in the same subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>personality</code> block supports:</p>",elementType:"p"},{name:"file",description:'<li><p><a name="file"></a><a href="#file"><code>file</code></a> - <strong>(Required)</strong> The absolute path of the destination file.</p>\n</li>',elementType:"li",listDepth:1},{name:"contents",description:'<li><p><a name="contents"></a><a href="#contents"><code>contents</code></a> - <strong>(Required)</strong> The contents of the file. Limited to 255 bytes.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/compute_instance_v2.html",docType:""},{id:8,type:"  telefonicaopencloud_compute_keypair_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Compute client.\nKeypairs are associated with accounts, but a Compute client is needed to\ncreate one. If omitted, the <code>region</code> argument of the provider is used.\nChanging this creates a new keypair.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the keypair. Changing this creates a new\nkeypair.</p>\n</li>',elementType:"li",listDepth:1},{name:"public_key",description:'<li><p><a name="public_key"></a><a href="#public_key"><code>public_key</code></a> - <strong>(Required)</strong> A pregenerated OpenSSH-formatted public key.\nChanging this creates a new keypair.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/compute_keypair_v2.html",docType:""},{id:9,type:"  telefonicaopencloud_compute_secgroup_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Compute client.\nA Compute client is needed to create a security group. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nsecurity group.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the security group. Changing this\nupdates the <code>name</code> of an existing security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Required)</strong> A description for the security group. Changing this\nupdates the <code>description</code> of an existing security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"rule",description:'<li><p><a name="rule"></a><a href="#rule"><code>rule</code></a> - <strong>(Optional)</strong> A rule describing how the security group operates. The\nrule object structure is documented below. Changing this updates the\nsecurity group rules. As shown in the example above, multiple rule blocks\nmay be used.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>rule</code> block supports:</p>",elementType:"p"},{name:"from_port",description:'<li><p><a name="from_port"></a><a href="#from_port"><code>from_port</code></a> - <strong>(Required)</strong> An integer representing the lower bound of the port\nrange to open. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"to_port",description:'<li><p><a name="to_port"></a><a href="#to_port"><code>to_port</code></a> - <strong>(Required)</strong> An integer representing the upper bound of the port\nrange to open. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_protocol",description:'<li><p><a name="ip_protocol"></a><a href="#ip_protocol"><code>ip_protocol</code></a> - <strong>(Required)</strong> The protocol type that will be allowed. Changing\nthis creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"cidr",description:'<li><p><a name="cidr"></a><a href="#cidr"><code>cidr</code></a> - <strong>(Optional)</strong> Required if <code>from_group_id</code> or <code>self</code> is empty. The IP range\nthat will be the source of network traffic to the security group. Use 0.0.0.0/0\nto allow all IP addresses. Changing this creates a new security group rule. Cannot\nbe combined with <code>from_group_id</code> or <code>self</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"from_group_id",description:'<li><p><a name="from_group_id"></a><a href="#from_group_id"><code>from_group_id</code></a> - <strong>(Optional)</strong> Required if <code>cidr</code> or <code>self</code> is empty. The ID of a\ngroup from which to forward traffic to the parent group. Changing this creates a\nnew security group rule. Cannot be combined with <code>cidr</code> or <code>self</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"self",description:'<li><p><a name="self"></a><a href="#self"><code>self</code></a> - <strong>(Optional)</strong> Required if <code>cidr</code> and <code>from_group_id</code> is empty. If true,\nthe security group itself will be added as a source to this ingress rule. Cannot\nbe combined with <code>cidr</code> or <code>from_group_id</code>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/compute_secgroup_v2.html",docType:""},{id:10,type:"  telefonicaopencloud_compute_servergroup_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Compute client.\nIf omitted, the <code>region</code> argument of the provider is used. Changing\nthis creates a new server group.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the server group. Changing this creates\na new server group.</p>\n</li>',elementType:"li",listDepth:1},{name:"policies",description:'<li><p><a name="policies"></a><a href="#policies"><code>policies</code></a> - <strong>(Required)</strong> The set of policies for the server group. Only two\ntwo policies are available right now, and both are mutually exclusive. See\nthe Policies section for more information. Changing this creates a new\nserver group.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"policies-1",description:'<h2 id="policies-1">\n<a class="anchor" href="#policies-1" name="policies-1">\xbb</a>\n  Policies\n</h2>',elementType:"h2"},{name:"affinity",description:'<li><p><a name="affinity"></a><a href="#affinity"><code>affinity</code></a> - All instances/servers launched in this group will be hosted on\nthe same compute node.</p>\n</li>',elementType:"li",listDepth:1},{name:"anti-affinity",description:'<li><p><a name="anti-affinity"></a><a href="#anti-affinity"><code>anti-affinity</code></a> - All instances/servers launched in this group will be\nhosted on different compute nodes.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/compute_servergroup_v2.html",docType:""},{id:11,type:"  telefonicaopencloud_compute_volume_attach_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Compute client.\nA Compute client is needed to create a volume attachment. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a\nnew volume attachment.</p>\n</li>',elementType:"li",listDepth:1},{name:"instance_id",description:'<li><p><a name="instance_id"></a><a href="#instance_id"><code>instance_id</code></a> - <strong>(Required)</strong> The ID of the Instance to attach the Volume to.</p>\n</li>',elementType:"li",listDepth:1},{name:"volume_id",description:'<li><p><a name="volume_id"></a><a href="#volume_id"><code>volume_id</code></a> - <strong>(Required)</strong> The ID of the Volume to attach to an Instance.</p>\n</li>',elementType:"li",listDepth:1},{name:"device",description:'<li><p><a name="device"></a><a href="#device"><code>device</code></a> - <strong>(Optional)</strong> The device of the volume attachment (ex: <code>/dev/vdc</code>).\n<em>NOTE</em>: Being able to specify a device is dependent upon the hypervisor in\nuse. There is a chance that the device specified in Terraform will not be\nthe same device the hypervisor chose. If this happens, Terraform will wish\nto update the device upon subsequent applying which will cause the volume\nto be detached and reattached indefinitely. Please use with caution.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/compute_volume_attach_v2.html",docType:""},{id:12,type:"  telefonicaopencloud_dns_recordset_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 DNS client.\nIf omitted, the <code>region</code> argument of the provider is used.\nChanging this creates a new DNS  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"zone_id",description:'<li><p><a name="zone_id"></a><a href="#zone_id"><code>zone_id</code></a> - <strong>(Required)</strong> The ID of the zone in which to create the record set.\nChanging this creates a new DNS  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the record set. Note the <code>.</code> at the end of the name.\nChanging this creates a new DNS  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Optional)</strong> The type of record set. Examples: "A", "MX".\nChanging this creates a new DNS  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"ttl",description:'<li><p><a name="ttl"></a><a href="#ttl"><code>ttl</code></a> - <strong>(Optional)</strong> The time to live (TTL) of the record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the  record set.</p>\n</li>',elementType:"li",listDepth:1},{name:"records",description:'<li><p><a name="records"></a><a href="#records"><code>records</code></a> - <strong>(Optional)</strong> An array of DNS records.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options. Changing this creates a\nnew record set.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/dns_recordset_v2.html",docType:""},{id:13,type:"  telefonicaopencloud_dns_zone_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Compute client.\nKeypairs are associated with accounts, but a Compute client is needed to\ncreate one. If omitted, the <code>region</code> argument of the provider is used.\nChanging this creates a new DNS zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the zone. Note the <code>.</code> at the end of the name.\nChanging this creates a new DNS zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"email",description:'<li><p><a name="email"></a><a href="#email"><code>email</code></a> - <strong>(Optional)</strong> The email contact for the zone record.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Optional)</strong> The type of zone. Can either be <code>PRIMARY</code> or <code>SECONDARY</code>.\nChanging this creates a new zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"attributes",description:'<li><p><a name="attributes"></a><a href="#attributes"><code>attributes</code></a> - <strong>(Optional)</strong> Attributes for the DNS Service scheduler.\nChanging this creates a new zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"ttl",description:'<li><p><a name="ttl"></a><a href="#ttl"><code>ttl</code></a> - <strong>(Optional)</strong> The time to live (TTL) of the zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A description of the zone.</p>\n</li>',elementType:"li",listDepth:1},{name:"masters",description:'<li><p><a name="masters"></a><a href="#masters"><code>masters</code></a> - <strong>(Optional)</strong> An array of master DNS servers. For when <code>type</code> is\n<code>SECONDARY</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options. Changing this creates a\nnew zone.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/dns_zone_v2.html",docType:""},{id:14,type:"  telefonicaopencloud_networking_floatingip_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Networking client.\nA Networking client is needed to create a floating IP that can be used with\nanother networking resource, such as a load balancer. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nfloating IP (which may or may not have a different address).</p>\n</li>',elementType:"li",listDepth:1},{name:"pool",description:'<li><p><a name="pool"></a><a href="#pool"><code>pool</code></a> - <strong>(Required)</strong> The name of the pool from which to obtain the floating\nIP. Changing this creates a new floating IP.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_id",description:'<li><p><a name="port_id"></a><a href="#port_id"><code>port_id</code></a> - <strong>(Optional)</strong> ID of an existing port with at least one IP address to\nassociate with this floating IP.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The target tenant ID in which to allocate the floating\nIP, if you specify this together with a port_id, make sure the target port\nbelongs to the same tenant. Changing this creates a new floating IP (which\nmay or may not have a different address)</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip",description:'<li><p><a name="fixed_ip"></a><a href="#fixed_ip"><code>fixed_ip</code></a> - Fixed IP of the port to associate with this floating IP. Required if\nthe port has multiple fixed IPs.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_floatingip_v2.html",docType:""},{id:15,type:"  telefonicaopencloud_networking_network_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Networking client.\nA Networking client is needed to create a Neutron network. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nnetwork.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> The name of the network. Changing this updates the name of\nthe existing network.</p>\n</li>',elementType:"li",listDepth:1},{name:"shared",description:'<li><p><a name="shared"></a><a href="#shared"><code>shared</code></a> - <strong>(Optional)</strong>  Specifies whether the network resource can be accessed\nby any tenant or not. Changing this updates the sharing capabalities of the\nexisting network.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the network. Required if admin wants to\ncreate a network for another tenant. Changing this creates a new network.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> The administrative state of the network.\nAcceptable values are "true" and "false". Changing this value updates the\nstate of the existing network.</p>\n</li>',elementType:"li",listDepth:1},{name:"segments",description:'<li><p><a name="segments"></a><a href="#segments"><code>segments</code></a> - <strong>(Optional)</strong> An array of one or more provider segment objects.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>segments</code> block supports:</p>",elementType:"p"},{name:"physical_network",description:"The phisical network where this network is implemented.\n",elementType:"li",listDepth:1},{name:"segmentation_id",description:"An isolated segment on the physical network.\n",elementType:"li",listDepth:1},{name:"network_type",description:"The type of physical network.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_network_v2.html",docType:""},{id:16,type:"  telefonicaopencloud_networking_port_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 networking client.\nA networking client is needed to create a port. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nport.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the port. Changing this\nupdates the <code>name</code> of an existing port.</p>\n</li>',elementType:"li",listDepth:1},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> - <strong>(Required)</strong> The ID of the network to attach the port to. Changing\nthis creates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> Administrative up/down status for the port\n(must be "true" or "false" if provided). Changing this updates the\n<code>admin_state_up</code> of an existing port.</p>\n</li>',elementType:"li",listDepth:1},{name:"mac_address",description:'<li><p><a name="mac_address"></a><a href="#mac_address"><code>mac_address</code></a> - <strong>(Optional)</strong> Specify a specific MAC address for the port. Changing\nthis creates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the Port. Required if admin wants\nto create a port for another tenant. Changing this creates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"device_owner",description:'<li><p><a name="device_owner"></a><a href="#device_owner"><code>device_owner</code></a> - <strong>(Optional)</strong> The device owner of the Port. Changing this creates\na new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_ids",description:'<li><p><a name="security_group_ids"></a><a href="#security_group_ids"><code>security_group_ids</code></a> - (Optional - Conflicts with <code>no_security_groups</code>) A list\nof security group IDs to apply to the port. The security groups must be\nspecified by ID and not name (as opposed to how they are configured with\nthe Compute Instance).</p>\n</li>',elementType:"li",listDepth:1},{name:"no_security_groups",description:'<li><p><a name="no_security_groups"></a><a href="#no_security_groups"><code>no_security_groups</code></a> - (Optional - Conflicts with <code>security_group_ids</code>) If set to\n<code>true</code>, then no security groups are applied to the port. If set to <code>false</code> and\nno <code>security_group_ids</code> are specified, then the Port will yield to the default\nbehavior of the Networking service, which is to usually apply the "default"\nsecurity group.</p>\n</li>',elementType:"li",listDepth:1},{name:"device_id",description:'<li><p><a name="device_id"></a><a href="#device_id"><code>device_id</code></a> - <strong>(Optional)</strong> The ID of the device attached to the port. Changing this\ncreates a new port.</p>\n</li>',elementType:"li",listDepth:1},{name:"fixed_ip",description:'<li><p><a name="fixed_ip"></a><a href="#fixed_ip"><code>fixed_ip</code></a> - <strong>(Optional)</strong> An array of desired IPs for this port. The structure is\ndescribed below.</p>\n</li>',elementType:"li",listDepth:1},{name:"allowed_address_pairs",description:'<li><p><a name="allowed_address_pairs"></a><a href="#allowed_address_pairs"><code>allowed_address_pairs</code></a> - <strong>(Optional)</strong> An IP/MAC Address pair of additional IP\naddresses that can be active on this port. The structure is described\nbelow.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>fixed_ip</code> block supports:</p>",elementType:"p"},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Required)</strong> Subnet in which to allocate IP address for\nthis port.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - <strong>(Optional)</strong> IP address desired in the subnet for this port. If\nyou don\'t specify <code>ip_address</code>, an available IP address from the specified\nsubnet will be allocated to this port. This field will not be populated if it\nis left blank. To retrieve the assigned IP address, use the <code>all_fixed_ips</code>\nattribute.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>allowed_address_pairs</code> block supports:</p>",elementType:"p"},{name:"ip_address",description:'<li><p><a name="ip_address-1"></a><a href="#ip_address-1"><code>ip_address</code></a> - <strong>(Required)</strong> The additional IP address.</p>\n</li>',elementType:"li",listDepth:1},{name:"mac_address",description:'<li><p><a name="mac_address-1"></a><a href="#mac_address-1"><code>mac_address</code></a> - <strong>(Optional)</strong> The additional MAC address.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_port_v2.html",docType:""},{id:17,type:"  telefonicaopencloud_networking_router_interface_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 networking client.\nA networking client is needed to create a router. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nrouter interface.</p>\n</li>',elementType:"li",listDepth:1},{name:"router_id",description:'<li><p><a name="router_id"></a><a href="#router_id"><code>router_id</code></a> - <strong>(Required)</strong> ID of the router this interface belongs to. Changing\nthis creates a new router interface.</p>\n</li>',elementType:"li",listDepth:1},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - ID of the subnet this interface connects to. Changing\nthis creates a new router interface.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_id",description:'<li><p><a name="port_id"></a><a href="#port_id"><code>port_id</code></a> - ID of the port this interface connects to. Changing\nthis creates a new router interface.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_router_interface_v2.html",docType:""},{id:18,type:"  telefonicaopencloud_networking_router_route_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 networking client.\nA networking client is needed to configure a routing entry on a router. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nrouting entry.</p>\n</li>',elementType:"li",listDepth:1},{name:"router_id",description:'<li><p><a name="router_id"></a><a href="#router_id"><code>router_id</code></a> - <strong>(Required)</strong> ID of the router this routing entry belongs to. Changing\nthis creates a new routing entry.</p>\n</li>',elementType:"li",listDepth:1},{name:"destination_cidr",description:'<li><p><a name="destination_cidr"></a><a href="#destination_cidr"><code>destination_cidr</code></a> - <strong>(Required)</strong> CIDR block to match on the packet\u2019s destination IP. Changing\nthis creates a new routing entry.</p>\n</li>',elementType:"li",listDepth:1},{name:"next_hop",description:'<li><p><a name="next_hop"></a><a href="#next_hop"><code>next_hop</code></a> - <strong>(Required)</strong> IP address of the next hop gateway.  Changing\nthis creates a new routing entry.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_router_route_v2.html",docType:""},{id:19,type:"  telefonicaopencloud_networking_router_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 networking client.\nA networking client is needed to create a router. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nrouter.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> A unique name for the router. Changing this\nupdates the <code>name</code> of an existing router.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Optional)</strong> Administrative up/down status for the router\n(must be "true" or "false" if provided). Changing this updates the\n<code>admin_state_up</code> of an existing router.</p>\n</li>',elementType:"li",listDepth:1},{name:"distributed",description:'<li><p><a name="distributed"></a><a href="#distributed"><code>distributed</code></a> - <strong>(Optional)</strong> Indicates whether or not to create a\ndistributed router. The default policy setting in Neutron restricts\nusage of this property to administrative users only.</p>\n</li>',elementType:"li",listDepth:1},{name:"external_gateway",description:'<li><p><a name="external_gateway"></a><a href="#external_gateway"><code>external_gateway</code></a> - (Deprecated - use <code>external_network_id</code> instead) The\nnetwork UUID of an external gateway for the router. A router with an\nexternal gateway is required if any compute instances or load balancers\nwill be using floating IPs. Changing this updates the external gateway\nof an existing router.</p>\n</li>',elementType:"li",listDepth:1},{name:"external_network_id",description:'<li><p><a name="external_network_id"></a><a href="#external_network_id"><code>external_network_id</code></a> - <strong>(Optional)</strong> The network UUID of an external gateway\nfor the router. A router with an external gateway is required if any\ncompute instances or load balancers will be using floating IPs. Changing\nthis updates the external gateway of the router.</p>\n</li>',elementType:"li",listDepth:1},{name:"enable_snat",description:'<li><p><a name="enable_snat"></a><a href="#enable_snat"><code>enable_snat</code></a> - <strong>(Optional)</strong> Enable Source NAT for the router. Valid values are\n"true" or "false". An <code>external_network_id</code> has to be set in order to\nset this property. Changing this updates the <code>enable_snat</code> of the router.</p>\n</li>',elementType:"li",listDepth:1},{name:"external_fixed_ip",description:'<li><p><a name="external_fixed_ip"></a><a href="#external_fixed_ip"><code>external_fixed_ip</code></a> - <strong>(Optional)</strong> An external fixed IP for the router. This\ncan be repeated. The structure is described below. An <code>external_network_id</code>\nhas to be set in order to set this property. Changing this updates the\nexternal fixed IPs of the router.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the floating IP. Required if admin wants\nto create a router for another tenant. Changing this creates a new router.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional driver-specific options.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>external_fixed_ip</code> block supports:</p>",elementType:"p"},{name:"subnet_id",description:'<li><p><a name="subnet_id"></a><a href="#subnet_id"><code>subnet_id</code></a> - <strong>(Optional)</strong> Subnet in which the fixed IP belongs to.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - <strong>(Optional)</strong> The IP address to set on the router.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_router_v2.html",docType:""},{id:20,type:"  telefonicaopencloud_networking_subnet_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 Networking client.\nA Networking client is needed to create a Neutron subnet. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nsubnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"network_id",description:'<li><p><a name="network_id"></a><a href="#network_id"><code>network_id</code></a> - <strong>(Required)</strong> The UUID of the parent network. Changing this\ncreates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"cidr",description:'<li><p><a name="cidr"></a><a href="#cidr"><code>cidr</code></a> - <strong>(Required)</strong> CIDR representing IP range for this subnet, based on IP\nversion. Changing this creates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_version",description:'<li><p><a name="ip_version"></a><a href="#ip_version"><code>ip_version</code></a> - <strong>(Optional)</strong> IP version, either 4 (default) or 6. Changing this creates a\nnew subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Optional)</strong> The name of the subnet. Changing this updates the name of\nthe existing subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the subnet. Required if admin wants to\ncreate a subnet for another tenant. Changing this creates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"allocation_pools",description:'<li><p><a name="allocation_pools"></a><a href="#allocation_pools"><code>allocation_pools</code></a> - <strong>(Optional)</strong> An array of sub-ranges of CIDR available for\ndynamic allocation to ports. The allocation_pool object structure is\ndocumented below. Changing this creates a new subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"gateway_ip",description:'<li><p><a name="gateway_ip"></a><a href="#gateway_ip"><code>gateway_ip</code></a> - <strong>(Optional)</strong>  Default gateway used by devices in this subnet.\nLeaving this blank and not setting <code>no_gateway</code> will cause a default\ngateway of <code>.1</code> to be used. Changing this updates the gateway IP of the\nexisting subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"no_gateway",description:'<li><p><a name="no_gateway"></a><a href="#no_gateway"><code>no_gateway</code></a> - <strong>(Optional)</strong> Do not set a gateway IP on this subnet. Changing\nthis removes or adds a default gateway IP of the existing subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"enable_dhcp",description:'<li><p><a name="enable_dhcp"></a><a href="#enable_dhcp"><code>enable_dhcp</code></a> - <strong>(Optional)</strong> The administrative state of the network.\nAcceptable values are "true" and "false". Changing this value enables or\ndisables the DHCP capabilities of the existing subnet. Defaults to true.</p>\n</li>',elementType:"li",listDepth:1},{name:"dns_nameservers",description:'<li><p><a name="dns_nameservers"></a><a href="#dns_nameservers"><code>dns_nameservers</code></a> - <strong>(Optional)</strong> An array of DNS name server names used by hosts\nin this subnet. Changing this updates the DNS name servers for the existing\nsubnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"host_routes",description:'<li><p><a name="host_routes"></a><a href="#host_routes"><code>host_routes</code></a> - <strong>(Optional)</strong> An array of routes that should be used by devices\nwith IPs from this subnet (not including local subnet route). The host_route\nobject structure is documented below. Changing this updates the host routes\nfor the existing subnet.</p>\n</li>',elementType:"li",listDepth:1},{name:"value_specs",description:'<li><p><a name="value_specs"></a><a href="#value_specs"><code>value_specs</code></a> - <strong>(Optional)</strong> Map of additional options.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>allocation_pools</code> block supports:</p>",elementType:"p"},{name:"start",description:'<li><p><a name="start"></a><a href="#start"><code>start</code></a> - <strong>(Required)</strong> The starting address.</p>\n</li>',elementType:"li",listDepth:1},{name:"end",description:'<li><p><a name="end"></a><a href="#end"><code>end</code></a> - <strong>(Required)</strong> The ending address.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>host_routes</code> block supports:</p>",elementType:"p"},{name:"destination_cidr",description:'<li><p><a name="destination_cidr"></a><a href="#destination_cidr"><code>destination_cidr</code></a> - <strong>(Required)</strong> The destination CIDR.</p>\n</li>',elementType:"li",listDepth:1},{name:"next_hop",description:'<li><p><a name="next_hop"></a><a href="#next_hop"><code>next_hop</code></a> - <strong>(Required)</strong> The next hop in the route.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_subnet_v2.html",docType:""},{id:21,type:"  telefonicaopencloud_networking_secgroup_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 networking client.\nA networking client is needed to create a port. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nsecurity group.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> A unique name for the security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> A unique name for the security group.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the security group. Required if admin\nwants to create a port for another tenant. Changing this creates a new\nsecurity group.</p>\n</li>',elementType:"li",listDepth:1},{name:"delete_default_rules",description:'<li><p><a name="delete_default_rules"></a><a href="#delete_default_rules"><code>delete_default_rules</code></a> - <strong>(Optional)</strong> Whether or not to delete the default\negress security rules. This is <code>false</code> by default. See the below note\nfor more information.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_secgroup_v2.html",docType:""},{id:22,type:"  telefonicaopencloud_networking_secgroup_rule_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to obtain the V2 networking client.\nA networking client is needed to create a port. If omitted, the\n<code>region</code> argument of the provider is used. Changing this creates a new\nsecurity group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"direction",description:'<li><p><a name="direction"></a><a href="#direction"><code>direction</code></a> - <strong>(Required)</strong> The direction of the rule, valid values are <strong>ingress</strong>\nor <strong>egress</strong>. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"ethertype",description:'<li><p><a name="ethertype"></a><a href="#ethertype"><code>ethertype</code></a> - <strong>(Required)</strong> The layer 3 protocol type, valid values are <strong>IPv4</strong>\nor <strong>IPv6</strong>. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - (Optional) The layer 4 protocol type, valid values are following. Changing this creates a new security group rule. This is required if you want to specify a port range.</p>',elementType:"p"},{name:null,description:"<li><strong>tcp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>udp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>icmp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ah</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>dccp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>egp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>esp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>gre</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>igmp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-encap</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-frag</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-icmp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-nonxt</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-opts</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ipv6-route</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>ospf</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>pgm</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>rsvp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>sctp</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>udplite</strong>\n</li>",elementType:"li",listDepth:2},{name:null,description:"<li><strong>vrrp</strong>\n</li>",elementType:"li",listDepth:2},{name:"port_range_min",description:'<li><p><a name="port_range_min"></a><a href="#port_range_min"><code>port_range_min</code></a> - <strong>(Optional)</strong> The lower part of the allowed port range, valid\ninteger value needs to be between 1 and 65535. Changing this creates a new\nsecurity group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_range_max",description:'<li><p><a name="port_range_max"></a><a href="#port_range_max"><code>port_range_max</code></a> - <strong>(Optional)</strong> The higher part of the allowed port range, valid\ninteger value needs to be between 1 and 65535. Changing this creates a new\nsecurity group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"remote_ip_prefix",description:'<li><p><a name="remote_ip_prefix"></a><a href="#remote_ip_prefix"><code>remote_ip_prefix</code></a> - <strong>(Optional)</strong> The remote CIDR, the value needs to be a valid\nCIDR (i.e. 192.168.0.0/16). Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"remote_group_id",description:'<li><p><a name="remote_group_id"></a><a href="#remote_group_id"><code>remote_group_id</code></a> - <strong>(Optional)</strong> The remote group id, the value needs to be an\nOpenstack ID of a security group in the same tenant. Changing this creates\na new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_id",description:'<li><p><a name="security_group_id"></a><a href="#security_group_id"><code>security_group_id</code></a> - <strong>(Required)</strong> The security group id the rule should belong\nto, the value needs to be an Openstack ID of a security group in the same\ntenant. Changing this creates a new security group rule.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenant_id",description:'<li><p><a name="tenant_id"></a><a href="#tenant_id"><code>tenant_id</code></a> - <strong>(Optional)</strong> The owner of the security group. Required if admin\nwants to create a port for another tenant. Changing this creates a new\nsecurity group rule.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/networking_secgroup_rule_v2.html",docType:""},{id:23,type:"  telefonicaopencloud_elb_loadbalancer",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the load balancer name. The name is a string\nof 1 to 64 characters that consist of letters, digits, underscores (_),\nand hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Provides supplementary information about the\nlistener. The value is a string of 0 to 128 characters and cannot be &lt;&gt;.</p>\n</li>',elementType:"li",listDepth:1},{name:"vpc_id",description:'<li><p><a name="vpc_id"></a><a href="#vpc_id"><code>vpc_id</code></a> - <strong>(Required)</strong> Specifies the VPC ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth",description:'<li><p><a name="bandwidth"></a><a href="#bandwidth"><code>bandwidth</code></a> - <strong>(Optional)</strong> Specifies the bandwidth (Mbit/s). This parameter\nis mandatory when type is set to External, and it is invalid when type\nis set to Internal. The value ranges from 1 to 300.</p>\n</li>',elementType:"li",listDepth:1},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> Specifies the load balancer type. The value can be\nInternal or External.</p>\n</li>',elementType:"li",listDepth:1},{name:"admin_state_up",description:'<li><p><a name="admin_state_up"></a><a href="#admin_state_up"><code>admin_state_up</code></a> - <strong>(Required)</strong> Specifies the status of the load balancer.\nValue range: 0 or false: indicates that the load balancer is stopped. Only\ntenants are allowed to enter these two values. 1 or true: indicates that\nthe load balancer is running properly. 2 or false: indicates that the load\nbalancer is frozen. Only tenants are allowed to enter these two values.</p>\n</li>',elementType:"li",listDepth:1},{name:"vip_subnet_id",description:'<li><p><a name="vip_subnet_id"></a><a href="#vip_subnet_id"><code>vip_subnet_id</code></a> - <strong>(Optional)</strong> Specifies the ID of the private network\nto be added. This parameter is mandatory when type is set to Internal,\nand it is invalid when type is set to External.</p>\n</li>',elementType:"li",listDepth:1},{name:"az",description:'<li><p><a name="az"></a><a href="#az"><code>az</code></a> - <strong>(Optional)</strong> Specifies the ID of the availability zone (AZ). This\nparameter is mandatory when type is set to Internal, and it is invalid\nwhen type is set to External.</p>\n</li>',elementType:"li",listDepth:1},{name:"charge_mode",description:'<li><p><a name="charge_mode"></a><a href="#charge_mode"><code>charge_mode</code></a> - <strong>(Optional)</strong> This is a reserved field. If the system supports\ncharging by traffic and this field is specified, then you are charged by\ntraffic for elastic IP addresses. The value is traffic.</p>\n</li>',elementType:"li",listDepth:1},{name:"eip_type",description:'<li><p><a name="eip_type"></a><a href="#eip_type"><code>eip_type</code></a> - <strong>(Optional)</strong> This parameter is reserved.</p>\n</li>',elementType:"li",listDepth:1},{name:"security_group_id",description:'<li><p><a name="security_group_id"></a><a href="#security_group_id"><code>security_group_id</code></a> - <strong>(Optional)</strong> Specifies the security group ID. The\nvalue is a string of 1 to 200 characters that consists of uppercase and\nlowercase letters, digits, and hyphens (-). This parameter is mandatory\nonly when type is set to Internal.</p>\n</li>',elementType:"li",listDepth:1},{name:"vip_address",description:'<li><p><a name="vip_address"></a><a href="#vip_address"><code>vip_address</code></a> - <strong>(Optional)</strong> Specifies the IP address provided by ELB.\nWhen typeis set to External, the value of this parameter is the elastic\nIP address. When type is set to Internal, the value of this parameter is\nthe private network IP address. You can select an existing elastic IP address\nand create a public network load balancer. When this parameter is configured,\nparameters bandwidth, charge_mode, and eip_type are invalid.</p>\n</li>',elementType:"li",listDepth:1},{name:"tenantid",description:'<li><p><a name="tenantid"></a><a href="#tenantid"><code>tenantid</code></a> - <strong>(Optional)</strong> Specifies the tenant ID. This parameter is mandatory\nonly when type is set to Internal.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/elb_loadbalancer.html",docType:""},{id:24,type:"  telefonicaopencloud_elb_listener",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the load balancer name. The name is a string\nof 1 to 64 characters that consist of letters, digits, underscores (_), and\nhyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - <strong>(Optional)</strong> Provides supplementary information about the listener.\nThe value is a string of 0 to 128 characters and cannot be &lt;&gt;.</p>\n</li>',elementType:"li",listDepth:1},{name:"loadbalancer_id",description:'<li><p><a name="loadbalancer_id"></a><a href="#loadbalancer_id"><code>loadbalancer_id</code></a> - <strong>(Required)</strong> Specifies the ID of the load balancer to which\nthe listener belongs.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - <strong>(Required)</strong> Specifies the listening protocol used for layer 4\nor 7. The value can be HTTP, TCP, HTTPS, or UDP.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - <strong>(Required)</strong> Specifies the listening port. The value ranges from 1\nto 65535.</p>\n</li>',elementType:"li",listDepth:1},{name:"backend_protocol",description:'<li><p><a name="backend_protocol"></a><a href="#backend_protocol"><code>backend_protocol</code></a> - <strong>(Required)</strong> Specifies the backend protocol. If the value\nof protocol is UDP, the value of this parameter can only be UDP. The value can\nbe HTTP, TCP, or UDP.</p>\n</li>',elementType:"li",listDepth:1},{name:"backend_port",description:'<li><p><a name="backend_port"></a><a href="#backend_port"><code>backend_port</code></a> - <strong>(Required)</strong> Specifies the backend port. The value ranges from\n1 to 65535.</p>\n</li>',elementType:"li",listDepth:1},{name:"lb_algorithm",description:'<li><p><a name="lb_algorithm"></a><a href="#lb_algorithm"><code>lb_algorithm</code></a> - <strong>(Required)</strong> Specifies the load balancing algorithm for the\nlistener. The value can be roundrobin, leastconn, or source.</p>\n</li>',elementType:"li",listDepth:1},{name:"session_sticky",description:'<li><p><a name="session_sticky"></a><a href="#session_sticky"><code>session_sticky</code></a> - <strong>(Optional)</strong> Specifies whether to enable sticky session.\nThe value can be true or false. The Sticky session is enabled when the value\nis true, and is disabled when the value is false. If the value of protocol is\nHTTP, HTTPS, or TCP, and the value of lb_algorithm is not roundrobin, the value\nof this parameter can only be false.</p>\n</li>',elementType:"li",listDepth:1},{name:"sticky_session_type",description:'<li><p><a name="sticky_session_type"></a><a href="#sticky_session_type"><code>sticky_session_type</code></a> - <strong>(Optional)</strong> Specifies the cookie processing method.\nThe value is insert. insert indicates that the cookie is inserted by the load\nbalancer. This parameter is valid when protocol is set to HTTP, and session_sticky\nto true. The default value is insert. This parameter is invalid when protocol\nis set to TCP or UDP, which means the parameter is empty.</p>\n</li>',elementType:"li",listDepth:1},{name:"cookie_timeout",description:'<li><p><a name="cookie_timeout"></a><a href="#cookie_timeout"><code>cookie_timeout</code></a> - <strong>(Optional)</strong> Specifies the cookie timeout period (minutes).\nThis parameter is valid when protocol is set to HTTP, session_sticky to true,\nand sticky_session_type to insert. This parameter is invalid when protocol is\nset to TCP or UDP. The value ranges from 1 to 1440.</p>\n</li>',elementType:"li",listDepth:1},{name:"tcp_timeout",description:'<li><p><a name="tcp_timeout"></a><a href="#tcp_timeout"><code>tcp_timeout</code></a> - <strong>(Optional)</strong> Specifies the TCP timeout period (minutes). This\nparameter is valid when protocol is set to TCP. The value ranges from 1 to 5.</p>\n</li>',elementType:"li",listDepth:1},{name:"tcp_draining",description:'<li><p><a name="tcp_draining"></a><a href="#tcp_draining"><code>tcp_draining</code></a> - <strong>(Optional)</strong> Specifies whether to maintain the TCP connection\nto the backend ECS after the ECS is deleted. This parameter is valid when protocol\nis set to TCP. The value can be true or false.</p>\n</li>',elementType:"li",listDepth:1},{name:"tcp_draining_timeout",description:'<li><p><a name="tcp_draining_timeout"></a><a href="#tcp_draining_timeout"><code>tcp_draining_timeout</code></a> - <strong>(Optional)</strong> Specifies the timeout duration (minutes)\nfor the TCP connection to the backend ECS after the ECS is deleted. This parameter\nis valid when protocol is set to TCP, and tcp_draining to true. The value ranges\nfrom 0 to 60.</p>\n</li>',elementType:"li",listDepth:1},{name:"certificate_id",description:'<li><p><a name="certificate_id"></a><a href="#certificate_id"><code>certificate_id</code></a> - <strong>(Optional)</strong> Specifies the ID of the SSL certificate used\nfor security authentication when HTTPS is used to make API calls. This parameter\nis mandatory if the value of protocol is HTTPS. The value can be obtained by\nviewing the details of the SSL certificate.</p>\n</li>',elementType:"li",listDepth:1},{name:"udp_timeout",description:'<li><p><a name="udp_timeout"></a><a href="#udp_timeout"><code>udp_timeout</code></a> - <strong>(Optional)</strong> Specifies the UDP timeout duration (minutes). This\nparameter is valid when protocol is set to UDP. The value ranges from 1 to 1440.</p>\n</li>',elementType:"li",listDepth:1},{name:"ssl_protocols",description:'<li><p><a name="ssl_protocols"></a><a href="#ssl_protocols"><code>ssl_protocols</code></a> - <strong>(Optional)</strong> Specifies the SSL protocol standard supported\nby a tracker, which is used for enabling specified encryption protocols. This\nparameter is valid only when the value of protocol is set to HTTPS. The value\nis TLSv1.2 or TLSv1.2 TLSv1.1 TLSv1. The default value is TLSv1.2.</p>\n</li>',elementType:"li",listDepth:1},{name:"ssl_ciphers",description:'<li><p><a name="ssl_ciphers"></a><a href="#ssl_ciphers"><code>ssl_ciphers</code></a> - <strong>(Optional)</strong> Specifies the cipher suite of an encryption protocol.\nThis parameter is valid only when the value of protocol is set to HTTPS. The\nvalue is Default, Extended, or Strict. The default value is Default. The value\ncan only be set to Extended if the value of ssl_protocols is set to TLSv1.2\nTLSv1.1 TLSv1.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/elb_listener.html",docType:""},{id:25,type:"  telefonicaopencloud_elb_healthcheck",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"listener_id",description:'<li><p><a name="listener_id"></a><a href="#listener_id"><code>listener_id</code></a> - <strong>(Required)</strong> Specifies the ID of the listener to which the health\ncheck task belongs.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_protocol",description:'<li><p><a name="healthcheck_protocol"></a><a href="#healthcheck_protocol"><code>healthcheck_protocol</code></a> - <strong>(Optional)</strong> Specifies the protocol used for the health\ncheck. The value can be HTTP or TCP (case-insensitive).</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_uri",description:'<li><p><a name="healthcheck_uri"></a><a href="#healthcheck_uri"><code>healthcheck_uri</code></a> - <strong>(Optional)</strong> Specifies the URI for health check. This parameter\nis valid when healthcheck_ protocol is HTTP. The value is a string of 1 to 80\ncharacters that must start with a slash (/) and can only contain letters, digits,\nand special characters, such as -/.%?#&amp;.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_connect_port",description:'<li><p><a name="healthcheck_connect_port"></a><a href="#healthcheck_connect_port"><code>healthcheck_connect_port</code></a> - <strong>(Optional)</strong> Specifies the port used for the health\ncheck. The value ranges from 1 to 65535.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthy_threshold",description:'<li><p><a name="healthy_threshold"></a><a href="#healthy_threshold"><code>healthy_threshold</code></a> - <strong>(Optional)</strong> Specifies the threshold at which the health\ncheck result is success, that is, the number of consecutive successful health\nchecks when the health check result of the backend server changes from fail\nto success. The value ranges from 1 to 10.</p>\n</li>',elementType:"li",listDepth:1},{name:"unhealthy_threshold",description:'<li><p><a name="unhealthy_threshold"></a><a href="#unhealthy_threshold"><code>unhealthy_threshold</code></a> - <strong>(Optional)</strong> Specifies the threshold at which the health\ncheck result is fail, that is, the number of consecutive failed health checks\nwhen the health check result of the backend server changes from success to fail.\nThe value ranges from 1 to 10.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_timeout",description:'<li><p><a name="healthcheck_timeout"></a><a href="#healthcheck_timeout"><code>healthcheck_timeout</code></a> - <strong>(Optional)</strong> Specifies the maximum timeout duration\n(s) for the health check. The value ranges from 1 to 50.</p>\n</li>',elementType:"li",listDepth:1},{name:"healthcheck_interval",description:'<li><p><a name="healthcheck_interval"></a><a href="#healthcheck_interval"><code>healthcheck_interval</code></a> - <strong>(Optional)</strong> Specifies the maximum interval (s) for\nhealth check. The value ranges from 1 to 5.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/elb_healthcheck.html",docType:""},{id:26,type:"  telefonicaopencloud_elb_backendecs",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"listener_id",description:'<li><p><a name="listener_id"></a><a href="#listener_id"><code>listener_id</code></a> - <strong>(Required)</strong> Specifies the listener ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"server_id",description:'<li><p><a name="server_id"></a><a href="#server_id"><code>server_id</code></a> - <strong>(Required)</strong> Specifies the backend member ID.</p>\n</li>',elementType:"li",listDepth:1},{name:"private_address",description:'<li><p><a name="private_address"></a><a href="#private_address"><code>private_address</code></a> - <strong>(Required)</strong> Specifies the private IP address of the backend member.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/elb_backendecs.html",docType:""},{id:27,type:"  telefonicaopencloud_ces_alarmrule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"alarm_name",description:'<li><p><a name="alarm_name"></a><a href="#alarm_name"><code>alarm_name</code></a> - <strong>(Required)</strong> Specifies the name of an alarm rule. The value can\nbe a string of 1 to 128 characters that can consist of numbers, lowercase letters,\nuppercase letters, underscores (_), or hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_description",description:'<li><p><a name="alarm_description"></a><a href="#alarm_description"><code>alarm_description</code></a> - <strong>(Optional)</strong> The value can be a string of 0 to 256 characters.</p>\n</li>',elementType:"li",listDepth:1},{name:"metric",description:'<li><p><a name="metric"></a><a href="#metric"><code>metric</code></a> - <strong>(Required)</strong> Specifies the alarm metrics. The structure is described\nbelow.</p>\n</li>',elementType:"li",listDepth:1},{name:"condition",description:'<li><p><a name="condition"></a><a href="#condition"><code>condition</code></a> - <strong>(Required)</strong> Specifies the alarm triggering condition. The structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_actions",description:'<li><p><a name="alarm_actions"></a><a href="#alarm_actions"><code>alarm_actions</code></a> - <strong>(Optional)</strong> Specifies the action triggered by an alarm. The\nstructure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"insufficientdata_actions",description:'<li><p><a name="insufficientdata_actions"></a><a href="#insufficientdata_actions"><code>insufficientdata_actions</code></a> - <strong>(Optional)</strong> Specifies the action triggered by\ndata insufficiency. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"ok_actions",description:'<li><p><a name="ok_actions"></a><a href="#ok_actions"><code>ok_actions</code></a> - <strong>(Optional)</strong> Specifies the action triggered by the clearing of\nan alarm. The structure is described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_enabled",description:'<li><p><a name="alarm_enabled"></a><a href="#alarm_enabled"><code>alarm_enabled</code></a> - <strong>(Optional)</strong> Specifies whether to enable the alarm. The default\nvalue is true.</p>\n</li>',elementType:"li",listDepth:1},{name:"alarm_action_enabled",description:'<li><p><a name="alarm_action_enabled"></a><a href="#alarm_action_enabled"><code>alarm_action_enabled</code></a> - <strong>(Optional)</strong> Specifies whether to enable the action\nto be triggered by an alarm. The default value is true.\nNote: If alarm_action_enabled is set to true, at least one of the following\nparameters alarm_actions, insufficientdata_actions, and ok_actions cannot\nbe empty. If alarm_actions, insufficientdata_actions, and ok_actions coexist,\ntheir corresponding notification_list must be of the same value.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>metric</code> block supports:</p>",elementType:"p"},{name:"namespace",description:'<li><p><a name="namespace"></a><a href="#namespace"><code>namespace</code></a> - <strong>(Required)</strong> Specifies the namespace in service.item format. service.item\ncan be a string of 3 to 32 characters that must start with a letter and can\nconsists of uppercase letters, lowercase letters, numbers, or underscores (_).</p>\n</li>',elementType:"li",listDepth:1},{name:"metric_name",description:'<li><p><a name="metric_name"></a><a href="#metric_name"><code>metric_name</code></a> - <strong>(Required)</strong> Specifies the metric name. The value can be a string\nof 1 to 64 characters that must start with a letter and can consists of uppercase\nletters, lowercase letters, numbers, or underscores (_).</p>\n</li>',elementType:"li",listDepth:1},{name:"dimensions",description:'<li><p><a name="dimensions"></a><a href="#dimensions"><code>dimensions</code></a> - <strong>(Required)</strong> Specifies the list of metric dimensions. Currently,\nthe maximum length of the dimesion list that are supported is 3. The structure\nis described below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>dimensions</code> block supports:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> Specifies the dimension name. The value can be a string\nof 1 to 32 characters that must start with a letter and can consists of uppercase\nletters, lowercase letters, numbers, underscores (_), or hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value"></a><a href="#value"><code>value</code></a> - <strong>(Required)</strong> Specifies the dimension value. The value can be a string\nof 1 to 64 characters that must start with a letter or a number and can consists\nof uppercase letters, lowercase letters, numbers, underscores (_), or hyphens\n(-).</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>condition</code> block supports:</p>",elementType:"p"},{name:"period",description:'<li><p><a name="period"></a><a href="#period"><code>period</code></a> - <strong>(Required)</strong> Specifies the alarm checking period in seconds. The\nvalue can be 1, 300, 1200, 3600, 14400, and 86400.\nNote: If period is set to 1, the raw metric data is used to determine\nwhether to generate an alarm.</p>\n</li>',elementType:"li",listDepth:1},{name:"filter",description:'<li><p><a name="filter"></a><a href="#filter"><code>filter</code></a> - <strong>(Required)</strong> Specifies the data rollup methods. The value can be\nmax, min, average, sum, and vaiance.</p>\n</li>',elementType:"li",listDepth:1},{name:"comparison_operator",description:'<li><p><a name="comparison_operator"></a><a href="#comparison_operator"><code>comparison_operator</code></a> - <strong>(Required)</strong> Specifies the comparison condition of alarm\nthresholds. The value can be &gt;, =, &lt;, &gt;=, or &lt;=.</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value-1"></a><a href="#value-1"><code>value</code></a> - <strong>(Required)</strong> Specifies the alarm threshold. The value ranges from\n0 to Number of 1.7976931348623157e+308.</p>\n</li>',elementType:"li",listDepth:1},{name:"unit",description:'<li><p><a name="unit"></a><a href="#unit"><code>unit</code></a> - <strong>(Optional)</strong> Specifies the data unit.</p>\n</li>',elementType:"li",listDepth:1},{name:"count",description:'<li><p><a name="count"></a><a href="#count"><code>count</code></a> - <strong>(Required)</strong> Specifies the number of consecutive occurrence times.\nThe value ranges from 1 to 5.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>the <code>alarm_actions</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Optional)</strong> specifies the type of action triggered by an alarm. the\nvalue can be notification or autoscaling.\nnotification: indicates that a notification will be sent to the user.\nautoscaling: indicates that a scaling action will be triggered.</p>\n</li>',elementType:"li",listDepth:1},{name:"notification_list",description:'<li><p><a name="notification_list"></a><a href="#notification_list"><code>notification_list</code></a> - <strong>(Optional)</strong> specifies the topic urn list of the target\nnotification objects. the maximum length is 5. the topic urn list can be\nobtained from simple message notification (smn) and in the following format:\nurn: smn:([a-z]|[a-z]|[0-9]|-){1,32}:([a-z]|[a-z]|[0-9]){32}:([a-z]|[a-z]|[0-9]|-|_){1,256}.\nif type is set to notification, the value of notification_list cannot be\nempty. if type is set to autoscaling, the value of notification_list must\nbe [] and the value of namespace must be sys.as.\nNote: to enable the as alarm rules take effect, you must bind scaling\npolicies. for details, see the auto scaling api reference.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>the <code>insufficientdata_actions</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type-1"></a><a href="#type-1"><code>type</code></a> - <strong>(Optional)</strong> specifies the type of action triggered by an alarm. the\nvalue is notification.\nnotification: indicates that a notification will be sent to the user.</p>\n</li>',elementType:"li",listDepth:1},{name:"notification_list",description:'<li><p><a name="notification_list-1"></a><a href="#notification_list-1"><code>notification_list</code></a> - <strong>(Optional)</strong> indicates the list of objects to be notified\nif the alarm status changes. the maximum length is 5.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>the <code>ok_actions</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type-2"></a><a href="#type-2"><code>type</code></a> - <strong>(Optional)</strong> specifies the type of action triggered by an alarm. the\nvalue is notification.\nnotification: indicates that a notification will be sent to the user.</p>\n</li>',elementType:"li",listDepth:1},{name:"notification_list",description:'<li><p><a name="notification_list-2"></a><a href="#notification_list-2"><code>notification_list</code></a> - <strong>(Optional)</strong> indicates the list of objects to be notified\nif the alarm status changes. the maximum length is 5.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/ces_alarm_rule.html",docType:""},{id:28,type:"  telefonicaopencloud_s3_bucket",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"bucket",description:"(Optional, Forces new resource) The name of the bucket. If omitted, Terraform will assign a random, unique name.\n",elementType:"li",listDepth:1},{name:"bucket_prefix",description:"(Optional, Forces new resource) Creates a unique bucket name beginning with the specified prefix. Conflicts with <code>bucket</code>.\n",elementType:"li",listDepth:1},{name:"acl",description:'<strong>(Optional)</strong> The <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/acl-overview.html#canned-acl">canned ACL</a> to apply. Defaults to "private".\n',elementType:"li",listDepth:1},{name:"policy",description:'<strong>(Optional)</strong> A valid <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/example-bucket-policies.html">bucket policy</a> JSON document. Note that if the policy document is not specific enough (but still valid), Terraform may view the policy as constantly changing in a <code>terraform plan</code>. In this case, please make sure you use the verbose/specific version of the policy.\n',elementType:"li",listDepth:1},{name:"force_destroy",description:"(Optional, Default:false ) A boolean that indicates all objects should be deleted from the bucket so that the bucket can be destroyed without error. These objects are <em>not</em> recoverable.\n",elementType:"li",listDepth:1},{name:"website",description:"<strong>(Optional)</strong> A website object (documented below).\n",elementType:"li",listDepth:1},{name:"cors_rule",description:'<strong>(Optional)</strong> A rule of <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/cors.html">Cross-Origin Resource Sharing</a> (documented below).\n',elementType:"li",listDepth:1},{name:"versioning",description:'<strong>(Optional)</strong> A state of <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/Versioning.html">versioning</a> (documented below)\n',elementType:"li",listDepth:1},{name:"logging",description:'<strong>(Optional)</strong> A settings of <a href="https://docs.aws.amazon.com/AmazonS3/latest/UG/ManagingBucketLogging.html">bucket logging</a> (documented below).\n',elementType:"li",listDepth:1},{name:"lifecycle_rule",description:'<strong>(Optional)</strong> A configuration of <a href="http://docs.aws.amazon.com/AmazonS3/latest/dev/object-lifecycle-mgmt.html">object lifecycle management</a> (documented below).\n',elementType:"li",listDepth:1},{name:"region",description:"<strong>(Optional)</strong> If specified, the AWS region this bucket should reside in. Otherwise, the region used by the callee.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>website</code> object supports the following:</p>",elementType:"p"},{name:"index_document",description:"(Required, unless using <code>redirect_all_requests_to</code>) Amazon S3 returns this index document when requests are made to the root domain or any of the subfolders.\n",elementType:"li",listDepth:1},{name:"error_document",description:"<strong>(Optional)</strong> An absolute path to the document to return in case of a 4XX error.\n",elementType:"li",listDepth:1},{name:"redirect_all_requests_to",description:"<strong>(Optional)</strong> A hostname to redirect all website requests for this bucket to. Hostname can optionally be prefixed with a protocol (<code>http://</code> or <code>https://</code>) to use when redirecting requests. The default is the protocol that is used in the original request.\n",elementType:"li",listDepth:1},{name:"routing_rules",description:'<strong>(Optional)</strong> A json array containing <a href="https://docs.aws.amazon.com/AWSCloudFormation/latest/UserGuide/aws-properties-s3-websiteconfiguration-routingrules.html">routing rules</a>\ndescribing redirect behavior and when redirects are applied.\n',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>CORS</code> object supports the following:</p>",elementType:"p"},{name:"allowed_headers",description:" <strong>(Optional)</strong> Specifies which headers are allowed.\n",elementType:"li",listDepth:1},{name:"allowed_methods",description:" <strong>(Required)</strong> Specifies which methods are allowed. Can be <code>GET</code>, <code>PUT</code>, <code>POST</code>, <code>DELETE</code> or <code>HEAD</code>.\n",elementType:"li",listDepth:1},{name:"allowed_origins",description:" <strong>(Required)</strong> Specifies which origins are allowed.\n",elementType:"li",listDepth:1},{name:"expose_headers",description:" <strong>(Optional)</strong> Specifies expose header in the response.\n",elementType:"li",listDepth:1},{name:"max_age_seconds",description:" <strong>(Optional)</strong> Specifies time in seconds that browser can cache the response for a preflight request.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>versioning</code> object supports the following:</p>",elementType:"p"},{name:"enabled",description:"<strong>(Optional)</strong> Enable versioning. Once you version-enable a bucket, it can never return to an unversioned state. You can, however, suspend versioning on that bucket.\n",elementType:"li",listDepth:1},{name:"mfa_delete",description:"<strong>(Optional)</strong> Enable MFA delete for either <code>Change the versioning state of your bucket</code> or <code>Permanently delete an object version</code>. Default is <code>false</code>.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>logging</code> object supports the following:</p>",elementType:"p"},{name:"target_bucket",description:"<strong>(Required)</strong> The name of the bucket that will receive the log objects.\n",elementType:"li",listDepth:1},{name:"target_prefix",description:"<strong>(Optional)</strong> To specify a key prefix for log objects.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>lifecycle_rule</code> object supports the following:</p>",elementType:"p"},{name:"id",description:"<strong>(Optional)</strong> Unique identifier for the rule.\n",elementType:"li",listDepth:1},{name:"prefix",description:"<strong>(Optional)</strong> Object key prefix identifying one or more objects to which the rule applies.\n",elementType:"li",listDepth:1},{name:"enabled",description:"<strong>(Required)</strong> Specifies lifecycle rule status.\n",elementType:"li",listDepth:1},{name:"abort_incomplete_multipart_upload_days",description:" <strong>(Optional)</strong> Specifies the number of days after initiating a multipart upload when the multipart upload must be completed.\n",elementType:"li",listDepth:1},{name:"expiration",description:"<strong>(Optional)</strong> Specifies a period in the object's expire (documented below).\n",elementType:"li",listDepth:1},{name:"noncurrent_version_expiration",description:"<strong>(Optional)</strong> Specifies when noncurrent object versions expire (documented below).\n",elementType:"li",listDepth:1},{name:"",description:"<p>At least one of <code>expiration</code>, <code>noncurrent_version_expiration</code> must be specified.</p>",elementType:"p"},{name:"",description:"<p>The <code>expiration</code> object supports the following</p>",elementType:"p"},{name:"date",description:" <strong>(Optional)</strong> Specifies the date after which you want the corresponding action to take effect.\n",elementType:"li",listDepth:1},{name:"days",description:" <strong>(Optional)</strong> Specifies the number of days after object creation when the specific rule action takes effect.\n",elementType:"li",listDepth:1},{name:"expired_object_delete_marker",description:" <strong>(Optional)</strong> On a versioned bucket (versioning-enabled or versioning-suspended bucket), you can add this element in the lifecycle configuration to direct Amazon S3 to delete expired object delete markers.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>noncurrent_version_expiration</code> object supports the following</p>",elementType:"p"},{name:"days",description:" <strong>(Required)</strong> Specifies the number of days an object is noncurrent object versions expire.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>rules</code> object supports the following:</p>",elementType:"p"},{name:"id",description:"<strong>(Optional)</strong> Unique identifier for the rule.\n",elementType:"li",listDepth:1},{name:"destination",description:"<strong>(Required)</strong> Specifies the destination for the rule (documented below).\n",elementType:"li",listDepth:1},{name:"prefix",description:"<strong>(Required)</strong> Object keyname prefix identifying one or more objects to which the rule applies. Set as an empty string to replicate the whole bucket.\n",elementType:"li",listDepth:1},{name:"status",description:"<strong>(Required)</strong> The status of the rule. Either <code>Enabled</code> or <code>Disabled</code>. The rule is ignored if status is not Enabled.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>destination</code> object supports the following:</p>",elementType:"p"},{name:"bucket",description:"<strong>(Required)</strong> The ARN of the S3 bucket where you want Amazon S3 to store replicas of the object identified by the rule.\n",elementType:"li",listDepth:1},{name:"storage_class",description:"<strong>(Optional)</strong> The class of storage used to store the object.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/s3_bucket.html",docType:""},{id:29,type:"  telefonicaopencloud_s3_bucket_policy",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"bucket",description:"<strong>(Required)</strong> The name of the bucket to which to apply the policy.\n",elementType:"li",listDepth:1},{name:"policy",description:"<strong>(Required)</strong> The text of the policy.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/s3_bucket_policy.html",docType:""},{id:30,type:"  telefonicaopencloud_s3_bucket_object",properties:[{name:"",description:'<div class="alert alert-info" role="alert">\n<p><strong>Note:</strong> If you specify <code>content_encoding</code> you are responsible for encoding the body appropriately (i.e. <code>source</code> and <code>content</code> both expect already encoded/compressed bytes)</p>\n</div>',elementType:"div"},{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"bucket",description:"<strong>(Required)</strong> The name of the bucket to put the file in.\n",elementType:"li",listDepth:1},{name:"key",description:"<strong>(Required)</strong> The name of the object once it is in the bucket.\n",elementType:"li",listDepth:1},{name:"source",description:"<strong>(Required)</strong> The path to the source file being uploaded to the bucket.\n",elementType:"li",listDepth:1},{name:"content",description:"(Required unless <code>source</code> given) The literal content being uploaded to the bucket.\n",elementType:"li",listDepth:1},{name:"acl",description:'<strong>(Optional)</strong> The <a href="https://docs.aws.amazon.com/AmazonS3/latest/dev/acl-overview.html#canned-acl">canned ACL</a> to apply. Defaults to "private".\n',elementType:"li",listDepth:1},{name:"cache_control",description:'<strong>(Optional)</strong> Specifies caching behavior along the request/reply chain Read <a href="http://www.w3.org/Protocols/rfc2616/rfc2616-sec14.html#sec14.9">w3c cache_control</a> for further details.\n',elementType:"li",listDepth:1},{name:"content_disposition",description:'<strong>(Optional)</strong> Specifies presentational information for the object. Read <a href="http://www.w3.org/Protocols/rfc2616/rfc2616-sec19.html#sec19.5.1">wc3 content_disposition</a> for further information.\n',elementType:"li",listDepth:1},{name:"content_encoding",description:'<strong>(Optional)</strong> Specifies what content encodings have been applied to the object and thus what decoding mechanisms must be applied to obtain the media-type referenced by the Content-Type header field. Read <a href="http://www.w3.org/Protocols/rfc2616/rfc2616-sec14.html#sec14.11">w3c content encoding</a> for further information.\n',elementType:"li",listDepth:1},{name:"content_language",description:"<strong>(Optional)</strong> The language the content is in e.g. en-US or en-GB.\n",elementType:"li",listDepth:1},{name:"content_type",description:"<strong>(Optional)</strong> A standard MIME type describing the format of the object data, e.g. application/octet-stream. All Valid MIME Types are valid for this input.\n",elementType:"li",listDepth:1},{name:"website_redirect",description:'<strong>(Optional)</strong> Specifies a target URL for <a href="http://docs.aws.amazon.com/AmazonS3/latest/dev/how-to-page-redirect.html">website redirect</a>.\n',elementType:"li",listDepth:1},{name:"etag",description:'<strong>(Optional)</strong> Used to trigger updates. The only meaningful value is <code>${md5(file("path/to/file"))}</code>.\nThis attribute is not compatible with <code>kms_key_id</code>.\n',elementType:"li",listDepth:1},{name:"server_side_encryption",description:'<strong>(Optional)</strong> Specifies server-side encryption of the object in S3. Valid values are "<code>AES256</code>" and "<code>aws:kms</code>".\n',elementType:"li",listDepth:1},{name:"sse_kms_key_id",description:"<strong>(Optional)</strong> The ID of the kms key.\n",elementType:"li",listDepth:1},{name:"",description:"<p>Either <code>source</code> or <code>content</code> must be provided to specify the bucket content.\nThese two arguments are mutually-exclusive.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/s3_bucket_object.html",docType:""},{id:31,type:"  telefonicaopencloud_smn_topic_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the topic to be created.</p>\n</li>',elementType:"li",listDepth:1},{name:"display_name",description:'<li><p><a name="display_name"></a><a href="#display_name"><code>display_name</code></a> - <strong>(Optional)</strong> Topic display name, which is presented as the\nname of the email sender in an email message.</p>\n</li>',elementType:"li",listDepth:1},{name:"topic_urn",description:'<li><p><a name="topic_urn"></a><a href="#topic_urn"><code>topic_urn</code></a> - <strong>(Optional)</strong> Resource identifier of a topic, which is unique.</p>\n</li>',elementType:"li",listDepth:1},{name:"push_policy",description:'<li><p><a name="push_policy"></a><a href="#push_policy"><code>push_policy</code></a> - <strong>(Optional)</strong> Message pushing policy. 0 indicates that the message\nsending fails and the message is cached in the queue. 1 indicates that the\nfailed message is discarded.</p>\n</li>',elementType:"li",listDepth:1},{name:"create_time",description:'<li><p><a name="create_time"></a><a href="#create_time"><code>create_time</code></a> - <strong>(Optional)</strong> Time when the topic was created.</p>\n</li>',elementType:"li",listDepth:1},{name:"update_time",description:'<li><p><a name="update_time"></a><a href="#update_time"><code>update_time</code></a> - <strong>(Optional)</strong> Time when the topic was updated.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/smn_topic_v2.html",docType:""},{id:32,type:"  telefonicaopencloud_smn_subscription_v2",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"topic_urn",description:'<li><p><a name="topic_urn"></a><a href="#topic_urn"><code>topic_urn</code></a> - <strong>(Required)</strong> Resource identifier of a topic, which is unique.</p>\n</li>',elementType:"li",listDepth:1},{name:"endpoint",description:'<li><p><a name="endpoint"></a><a href="#endpoint"><code>endpoint</code></a> - <strong>(Required)</strong> Message endpoint.\n For an HTTP subscription, the endpoint starts with http://.\n For an HTTPS subscription, the endpoint starts with https://.\n For an email subscription, the endpoint is a mail address.\n For an SMS message subscription, the endpoint is a phone number.</p>\n</li>',elementType:"li",listDepth:1},{name:"protocol",description:'<li><p><a name="protocol"></a><a href="#protocol"><code>protocol</code></a> - <strong>(Required)</strong> Protocol of the message endpoint. Currently, email,\n sms, http, and https are supported.</p>\n</li>',elementType:"li",listDepth:1},{name:"remark",description:'<li><p><a name="remark"></a><a href="#remark"><code>remark</code></a> - <strong>(Optional)</strong> Remark information. The remarks must be a UTF-8-coded\n character string containing 128 bytes.</p>\n</li>',elementType:"li",listDepth:1},{name:"subscription_urn",description:'<li><p><a name="subscription_urn"></a><a href="#subscription_urn"><code>subscription_urn</code></a> - <strong>(Optional)</strong> Resource identifier of a subscription, which\n is unique.</p>\n</li>',elementType:"li",listDepth:1},{name:"owner",description:'<li><p><a name="owner"></a><a href="#owner"><code>owner</code></a> - <strong>(Optional)</strong> Project ID of the topic creator.</p>\n</li>',elementType:"li",listDepth:1},{name:"status",description:'<li><p><a name="status"></a><a href="#status"><code>status</code></a> - <strong>(Optional)</strong> Subscription status.\n 0 indicates that the subscription is not confirmed.\n 1 indicates that the subscription is confirmed.\n 3 indicates that the subscription is canceled.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/smn_subscription_v2.html",docType:""},{id:33,type:"  telefonicaopencloud_vpc_eip_v1",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"region",description:'<li><p><a name="region"></a><a href="#region"><code>region</code></a> - <strong>(Optional)</strong> The region in which to create the eip. If omitted,\nthe <code>region</code> argument of the provider is used. Changing this creates a new eip.</p>\n</li>',elementType:"li",listDepth:1},{name:"publicip",description:'<li><p><a name="publicip"></a><a href="#publicip"><code>publicip</code></a> - <strong>(Required)</strong> The elastic IP address object.</p>\n</li>',elementType:"li",listDepth:1},{name:"bandwidth",description:'<li><p><a name="bandwidth"></a><a href="#bandwidth"><code>bandwidth</code></a> - <strong>(Required)</strong> The bandwidth object.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>publicip</code> block supports:</p>",elementType:"p"},{name:"type",description:'<li><p><a name="type"></a><a href="#type"><code>type</code></a> - <strong>(Required)</strong> The value must be a type supported by the system. Only\n<code>5_bgp</code> supported now. Changing this creates a new eip.</p>\n</li>',elementType:"li",listDepth:1},{name:"ip_address",description:'<li><p><a name="ip_address"></a><a href="#ip_address"><code>ip_address</code></a> - <strong>(Optional)</strong> The value must be a valid IP address in the available\nIP address segment. Changing this creates a new eip.</p>\n</li>',elementType:"li",listDepth:1},{name:"port_id",description:'<li><p><a name="port_id"></a><a href="#port_id"><code>port_id</code></a> - <strong>(Optional)</strong> The port id which this eip will associate with. If the value\nis "" or this not specified, the eip will be in unbind state.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>bandwidth</code> block supports:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The bandwidth name, which is a string of 1 to 64 characters\nthat contain letters, digits, underscores (_), and hyphens (-).</p>\n</li>',elementType:"li",listDepth:1},{name:"size",description:'<li><p><a name="size"></a><a href="#size"><code>size</code></a> - <strong>(Required)</strong> The bandwidth size. The value ranges from 1 to 300 Mbit/s.</p>\n</li>',elementType:"li",listDepth:1},{name:"charge_type",description:'<li><p><a name="charge_type"></a><a href="#charge_type"><code>charge_type</code></a> - <strong>(Required)</strong> Whether the bandwidth is shared or exclusive. Changing\nthis creates a new eip.</p>\n</li>',elementType:"li",listDepth:1},{name:"charge_mode",description:'<li><p><a name="charge_mode"></a><a href="#charge_mode"><code>charge_mode</code></a> - <strong>(Optional)</strong> This is a reserved field. If the system supports charging\nby traffic and this field is specified, then you are charged by traffic for elastic\nIP addresses. Changing this creates a new eip.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/telefonicaopencloud/r/vpc_eip_v1.html",docType:""}]}}]);